window.bookSummaryJSON = "<p>My fated mate bond with Ryan may be sealed, but my troubles are only just beginning...</p> <p>Mai</p> <p>I’m on the run. Again. Only this time Ryan and his brothers are with me, and we’re being hunted by members of our old Pack. Betrayed and consumed with grief, all I can think about is getting vengeance. But we're struggling to regroup and strike back. Then a bombshell drops—Jem wanted Ryan and me to succeed him as the Alpha pair. I'm overwhelmed and don’t know if I'm ready to lead, but with danger closing in and the Pack in turmoil, I may have no choice but to embrace my destiny to protect the ones I love.</p> <p>Ryan</p> <p>My wolf just wants to protect Mai and keep her safe. But she doesn’t make it easy. She’s always had a fierce independent streak and now my protective instincts are in overdrive as we navigate our changing relationship and the threats coming at us. I’d do anything to protect Mai, but can our bond withstand the impossible choices we face? Time is running out for our wounded renegade Pack as a battle for control of the Three Rivers looms. Mai and I must unlock the power of our fated mate bond before our enemies destroy everything we hold dear.</p> <p>Listen to The Renegade Mate and enter the Shifter Realm today!</p>"; 
